import React from 'react';
import "../styles/QuizSearch.css"

const QuizSearch = () => {
    return (
        <div className="quizSearch-container">
            <form>
                <input type='text'></input>
                <input type='submit'></input>
            </form>
        </div>
    );
};

export default QuizSearch;
